import React, {useEffect} from "react";
import { useSelector, useDispatch } from "react-redux";
import { setOrdersValue } from "../../stores/Orders";
import axios from "axios";

const FoodOrder = () => {
  const meals = useSelector((state) => state.meals.value);
  const dispatch = useDispatch();

  useEffect(() => {
    const getMeals = async () => {
      try {
        const res = await axios.get("http://localhost:3000/meals");
        dispatch(setMealsValue(res.data));
      } catch (error) {
        console.log(error);
      }
    };

    getMeals();
  }, []);

  return <div>
    {meals.map(meal => {
        return (
            <img src={meal.img} alt="err" />
        )
    })}
  </div>;
};

export default FoodOrder;
